import React, { useEffect, useState } from 'react'
import styles from "./styles.module.css";
import _, { set } from 'lodash'
import { Button, Card, Divider, Image, Placeholder } from 'semantic-ui-react';

const Main = () => {
	const handleLogout = () => {
		localStorage.removeItem("token");
		window.location.reload();
	};

	const [loading,setLoading]=useState(false);
	const [cards,setCards]=useState()

	// const cards = [
	// 	{
	// 	  avatar: '/images/avatar/large/helen.jpg',
	// 	  date: 'Joined in 2013',
	// 	  header: 'Helen',
	// 	  description: 'Primary Contact',
	// 	},
	// 	{
	// 	  avatar: '/images/avatar/large/matthew.png',
	// 	  date: 'Joined in 2013',
	// 	  header: 'Matthew',
	// 	  description: 'Primary Contact',
	// 	},
	// 	{
	// 	  avatar: '/images/avatar/large/molly.png',
	// 	  date: 'Joined in 2013',
	// 	  header: 'Molly',
	// 	  description: 'Primary Contact',
	// 	},
	//   ]

	  useEffect(()=>{
		  fetch('https://raw.githubusercontent.com/syook/react-dishpoll/main/db.json')
		       .then(response =>response.json())
			   .then(data=>setCards(data))

	  })


	 const handleLoadingClick = () => {
		setLoading(true)

		setTimeout(() => {
		  setLoading(false)
		}, 3000)
	  }



	return (
		<div className={styles.main_container}>
			<nav className={styles.navbar}>
				<h1>Syook</h1>
				<button className={styles.white_btn} onClick={handleLogout}>
					Logout
				</button>
			</nav>

			<div>
			<Button loading={loading} onClick={handleLoadingClick} primary>
          Simulate loading
        </Button>
        <Divider />
			<Card.Group doubling itemsPerRow={3} stackable>
          {_.map(cards, (card) => (
            <Card key={card.header}>
              {loading ? (
                <Placeholder>
                  <Placeholder.Image square />
                </Placeholder>
              ) : (
                <Image src={card.avatar} />
              )}

              <Card.Content>
                {loading ? (
                  <Placeholder>
                    <Placeholder.Header>
                      <Placeholder.Line length='very short' />
                      <Placeholder.Line length='medium' />
                    </Placeholder.Header>
                    <Placeholder.Paragraph>
                      <Placeholder.Line length='short' />
                    </Placeholder.Paragraph>
                  </Placeholder>
                ) : (
                  <>
                    <Card.Header>{card.header}</Card.Header>
                    <Card.Meta>{card.date}</Card.Meta>
                    <Card.Description>{card.description}</Card.Description>
                  </>
                )}
              </Card.Content>

              <Card.Content extra>
                <Button disabled={loading} primary>
                  Add
                </Button>
                <Button disabled={loading}>Delete</Button>
              </Card.Content>
            </Card>
          ))}
        </Card.Group>
			</div>

		</div>
	);
};

export default Main;
